import React from "react";
import NFTCard from "./NFTCard";

const CardList = ({ list }) => {
  return (
    <div id="card-list">
      {list.map((item) => (
        <NFTCard nftSrc={item} />
      ))}
    </div>
  );
};

export default CardList;
